const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`此页面上列出的命令/步骤可用于检查中最重要的 Kubernetes 资源。`}</p>
    <p>{`确保您配置了正确的 kubeconfig（例如，Rancher 高可用时，`}<inlineCode parentName="p">{`export KUBECONFIG=$PWD/kube_config_rancher-cluster.yml`}</inlineCode>{`）或者通过 Rancher UI 使用内嵌的 kubectl。`}</p>
    <h2 {...{
      "id": "节点"
    }}>{`节点`}</h2>
    <h3 {...{
      "id": "获取节点"
    }}>{`获取节点`}</h3>
    <p>{`运行以下命令并检查以下内容：`}</p>
    <ul>
      <li parentName="ul">{`集群中的所有节点都应列出，确保没有任何节点丢失。`}</li>
      <li parentName="ul">{`所有节点都应处于`}<inlineCode parentName="li">{`Ready`}</inlineCode>{`状态（如果未处于`}<inlineCode parentName="li">{`Ready`}</inlineCode>{`状态，请使用`}<inlineCode parentName="li">{`docker logs kubelet`}</inlineCode>{`检查该节点上的`}<inlineCode parentName="li">{`kubelet`}</inlineCode>{`容器日志）`}</li>
      <li parentName="ul">{`检查所有节点是否是正确的版本。`}</li>
      <li parentName="ul">{`检查 OS/内核/Docker 值是否按预期显示（如果不正确可能是由于升级了 OS/内核/Docker 而引起的问题）`}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`kubectl get nodes -o wide
`}</code></pre>
    <p>{`输出示例：`}</p>
    <pre><code parentName="pre" {...{}}>{`NAME             STATUS   ROLES          AGE   VERSION   INTERNAL-IP      EXTERNAL-IP   OS-IMAGE             KERNEL-VERSION      CONTAINER-RUNTIME
controlplane-0   Ready    controlplane   31m   v1.13.5   138.68.188.91    <none>        Ubuntu 18.04.2 LTS   4.15.0-47-generic   docker://18.9.5
etcd-0           Ready    etcd           31m   v1.13.5   138.68.180.33    <none>        Ubuntu 18.04.2 LTS   4.15.0-47-generic   docker://18.9.5
worker-0         Ready    worker         30m   v1.13.5   139.59.179.88    <none>        Ubuntu 18.04.2 LTS   4.15.0-47-generic   docker://18.9.5
`}</code></pre>
    <h3 {...{
      "id": "获取节点-conditions"
    }}>{`获取节点 Conditions`}</h3>
    <p>{`运行以下命令以列出节点 Conditions，关于节点 Conditions 请查看`}<a parentName="p" {...{
        "href": "https://kubernetes.io/docs/concepts/architecture/nodes/#condition"
      }}>{`节点 Conditions`}</a></p>
    <pre><code parentName="pre" {...{}}>{`kubectl get nodes -o go-template='{{range .items}}{{$node := .}}{{range .status.conditions}}{{$node.metadata.name}}{{": "}}{{.type}}{{":"}}{{.status}}{{"\\n"}}{{end}}{{end}}'
`}</code></pre>
    <p>{`运行以下命令以列出节点有问题的 Conditions，关于节点 Conditions 请查看`}<a parentName="p" {...{
        "href": "https://kubernetes.io/docs/concepts/architecture/nodes/#condition"
      }}>{`节点 Conditions`}</a></p>
    <pre><code parentName="pre" {...{}}>{`kubectl get nodes -o go-template='{{range .items}}{{$node := .}}{{range .status.conditions}}{{if ne .type "Ready"}}{{if eq .status "True"}}{{$node.metadata.name}}{{": "}}{{.type}}{{":"}}{{.status}}{{"\\n"}}{{end}}{{else}}{{if ne .status "True"}}{{$node.metadata.name}}{{": "}}{{.type}}{{": "}}{{.status}}{{"\\n"}}{{end}}{{end}}{{end}}{{end}}'
`}</code></pre>
    <p>{`输出示例：`}</p>
    <pre><code parentName="pre" {...{}}>{`worker-0: DiskPressure:True
`}</code></pre>
    <h2 {...{
      "id": "kubernetes-leader-选举"
    }}>{`Kubernetes Leader 选举`}</h2>
    <h3 {...{
      "id": "kubernetes-controller-manager-leader"
    }}>{`Kubernetes Controller Manager Leader`}</h3>
    <p>{`leader 选举由选举程序决定。在确定了 leader 节点之后，leader 状态(`}<inlineCode parentName="p">{`holderIdentity`}</inlineCode>{`) 将会保存在 `}<inlineCode parentName="p">{`kube-controller-manager`}</inlineCode>{` endpoint 中 (在本示例中，leader 节点是`}<inlineCode parentName="p">{`controlplane-0`}</inlineCode>{`)。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n kube-system get endpoints kube-controller-manager -o jsonpath='{.metadata.annotations.control-plane\\.alpha\\.kubernetes\\.io/leader}'
{"holderIdentity":"controlplane-0_xxxxxxxx-xxxx-xxxx-xxxx-xxxxxxxxxxxx","leaseDurationSeconds":15,"acquireTime":"2018-12-27T08:59:45Z","renewTime":"2018-12-27T09:44:57Z","leaderTransitions":0}>
`}</code></pre>
    <h3 {...{
      "id": "kubernetes-scheduler-leader"
    }}>{`Kubernetes Scheduler Leader`}</h3>
    <p>{`leader 选举由选举程序决定。在确定了 leader 节点之后，leader 状态(`}<inlineCode parentName="p">{`holderIdentity`}</inlineCode>{`) 将会保存在 `}<inlineCode parentName="p">{`kube-scheduler`}</inlineCode>{` endpoint 中 (在本示例中，leader 节点是 `}<inlineCode parentName="p">{`controlplane-0`}</inlineCode>{`)。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n kube-system get endpoints kube-scheduler -o jsonpath='{.metadata.annotations.control-plane\\.alpha\\.kubernetes\\.io/leader}'
{"holderIdentity":"controlplane-0_xxxxxxxx-xxxx-xxxx-xxxx-xxxxxxxxxxxx","leaseDurationSeconds":15,"acquireTime":"2018-12-27T08:59:45Z","renewTime":"2018-12-27T09:44:57Z","leaderTransitions":0}>
`}</code></pre>
    <h2 {...{
      "id": "ingress-controller"
    }}>{`Ingress Controller`}</h2>
    <p>{`默认的 Ingress Controller 是 NGINX，并作为 DaemonSet 部署在`}<inlineCode parentName="p">{`ingress-nginx`}</inlineCode>{` 命名空间中。只能将该 Pod 调度到具有`}<inlineCode parentName="p">{`worker`}</inlineCode>{`角色的节点上。`}</p>
    <p>{`检查 Pod 是否在所有节点上运行：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx get pods -o wide
`}</code></pre>
    <p>{`示例输出：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx get pods -o wide
NAME                                    READY     STATUS    RESTARTS   AGE       IP               NODE
default-http-backend-797c5bc547-kwwlq   1/1       Running   0          17m       x.x.x.x          worker-1
nginx-ingress-controller-4qd64          1/1       Running   0          14m       x.x.x.x          worker-1
nginx-ingress-controller-8wxhm          1/1       Running   0          13m       x.x.x.x          worker-0
`}</code></pre>
    <p>{`如果 Pod 无法运行（状态不是 `}<strong parentName="p">{`Running`}</strong>{`，`}<inlineCode parentName="p">{`Ready`}</inlineCode>{`状态未显示为`}<inlineCode parentName="p">{`1/1`}</inlineCode>{`，或者您看到大量的`}<inlineCode parentName="p">{`Restart`}</inlineCode>{`次数），请检查 Pod 的详细信息，日志和 namespaces 事件。`}</p>
    <h3 {...{
      "id": "查看-pod-详细信息"
    }}>{`查看 Pod 详细信息`}</h3>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx describe pods -l app=ingress-nginx
`}</code></pre>
    <h3 {...{
      "id": "查看-pod-容器日志"
    }}>{`查看 Pod 容器日志`}</h3>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx logs -l app=ingress-nginx
`}</code></pre>
    <h3 {...{
      "id": "查看-namespace-事件"
    }}>{`查看 Namespace 事件`}</h3>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx get events
`}</code></pre>
    <h3 {...{
      "id": "debug-日志"
    }}>{`Debug 日志`}</h3>
    <p>{`执行下面命令开启 debug 日志：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx patch ds nginx-ingress-controller --type='json' -p='[{"op": "add", "path": "/spec/template/spec/containers/0/args/-", "value": "--v=5"}]'
`}</code></pre>
    <h3 {...{
      "id": "检查配置"
    }}>{`检查配置`}</h3>
    <p>{`查看每个 Pod 中生成的配置：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx get pods -l app=ingress-nginx --no-headers -o custom-columns=.NAME:.metadata.name | while read pod; do kubectl -n ingress-nginx exec $pod -- cat /etc/nginx/nginx.conf; done
`}</code></pre>
    <h2 {...{
      "id": "rancher-agents"
    }}>{`Rancher Agents`}</h2>
    <p>{`Rancher 通过 cluster-agent 与集群进行通信（通过`}<inlineCode parentName="p">{`cattle-cluster-agent`}</inlineCode>{`调用 Kubernetes API 与集群通讯），并且通过`}<inlineCode parentName="p">{`cattle-node-agent`}</inlineCode>{`与节点进行通信。`}</p>
    <h3 {...{
      "id": "cattle-node-agent"
    }}>{`cattle-node-agent`}</h3>
    <p>{`检查是否每个节点都正常运行了 cattle-node-agent, 正确运行的状态应该是 `}<strong parentName="p">{`Running`}</strong>{` 并且重启的次数应该不多。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system get pods -l app=cattle-agent -o wide
`}</code></pre>
    <p>{`输出示例：`}</p>
    <pre><code parentName="pre" {...{}}>{`NAME                      READY     STATUS    RESTARTS   AGE       IP                NODE
cattle-node-agent-4gc2p   1/1       Running   0          2h        x.x.x.x           worker-1
cattle-node-agent-8cxkk   1/1       Running   0          2h        x.x.x.x           etcd-1
cattle-node-agent-kzrlg   1/1       Running   0          2h        x.x.x.x           etcd-0
cattle-node-agent-nclz9   1/1       Running   0          2h        x.x.x.x           controlplane-0
cattle-node-agent-pwxp7   1/1       Running   0          2h        x.x.x.x           worker-0
cattle-node-agent-t5484   1/1       Running   0          2h        x.x.x.x           controlplane-1
cattle-node-agent-t8mtz   1/1       Running   0          2h        x.x.x.x           etcd-2
`}</code></pre>
    <p>{`检查特定节点上 cattle-node-agent 或者所有节点上 cattle-node-agent pods 的日志是否有错误：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system logs -l app=cattle-agent
`}</code></pre>
    <h3 {...{
      "id": "cattle-cluster-agent"
    }}>{`cattle-cluster-agent`}</h3>
    <p>{`检查集群中是否正确运行了 cattle-cluster-agent，正确运行的状态应该是 `}<strong parentName="p">{`Running`}</strong>{` 并且重启的次数应该不多。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system get pods -l app=cattle-cluster-agent -o wide
`}</code></pre>
    <p>{`输出示例：`}</p>
    <pre><code parentName="pre" {...{}}>{`NAME                                    READY     STATUS    RESTARTS   AGE       IP           NODE
cattle-cluster-agent-54d7c6c54d-ht9h4   1/1       Running   0          2h        x.x.x.x      worker-1
`}</code></pre>
    <p>{`检查 cattle-cluster-agent pod 的日志是否有错误:`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system logs -l app=cattle-cluster-agent
`}</code></pre>
    <h2 {...{
      "id": "其他"
    }}>{`其他`}</h2>
    <h3 {...{
      "id": "检查所有-podsjobs-的状态"
    }}>{`检查所有 Pods/Jobs 的状态`}</h3>
    <p>{`执行以下命令进行检查集群中所有 Pod/Job 是否正常运行：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl get pods --all-namespaces
`}</code></pre>
    <p>{`Pods 和 Jobs 正确运行的状态应该是：`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`Running`}</strong>{`，并且重启的次数应该不多。`}</li>
      <li parentName="ul">{`或者是`}<strong parentName="li">{`Completed`}</strong>{`，已经完成运行。`}</li>
    </ul>
    <h3 {...{
      "id": "查看-pod-详细信息-1"
    }}>{`查看 Pod 详细信息`}</h3>
    <pre><code parentName="pre" {...{}}>{`kubectl describe pod POD_NAME -n NAMESPACE
`}</code></pre>
    <h3 {...{
      "id": "查看-pod-日志"
    }}>{`查看 Pod 日志`}</h3>
    <pre><code parentName="pre" {...{}}>{`kubectl logs POD_NAME -n NAMESPACE
`}</code></pre>
    <p>{`如果 Job 状态是 `}<strong parentName="p">{`Completed`}</strong>{` 则可以通过以下命令检查未完成原因：`}</p>
    <h3 {...{
      "id": "查看-job-详细信息"
    }}>{`查看 Job 详细信息`}</h3>
    <pre><code parentName="pre" {...{}}>{`kubectl describe job JOB_NAME -n NAMESPACE
`}</code></pre>
    <h3 {...{
      "id": "查看-job-pod-的日志"
    }}>{`查看 Job Pod 的日志`}</h3>
    <pre><code parentName="pre" {...{}}>{`kubectl logs -l job-name=JOB_NAME -n NAMESPACE
`}</code></pre>
    <h3 {...{
      "id": "被驱逐的-pod"
    }}>{`被驱逐的 Pod`}</h3>
    <p>{`Pod 会根据`}<a parentName="p" {...{
        "href": "https://kubernetes.io/docs/tasks/administer-cluster/out-of-resource/#eviction-policy"
      }}>{`驱逐信号`}</a>{`中的描述进行驱逐。`}</p>
    <p>{`查看被逐出的 Pod 列表（Pod 名称和命名空间）：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl get pods --all-namespaces -o go-template='{{range .items}}{{if eq .status.phase "Failed"}}{{if eq .status.reason "Evicted"}}{{.metadata.name}}{{" "}}{{.metadata.namespace}}{{"\\n"}}{{end}}{{end}}{{end}}'
`}</code></pre>
    <p>{`要删除所有被驱逐的 Pod，`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl get pods --all-namespaces -o go-template='{{range .items}}{{if eq .status.phase "Failed"}}{{if eq .status.reason "Evicted"}}{{.metadata.name}}{{" "}}{{.metadata.namespace}}{{"\\n"}}{{end}}{{end}}{{end}}' | while read epod enamespace; do kubectl -n $enamespace delete pod $epod; done
`}</code></pre>
    <p>{`检查被逐出的 Pod，已调度节点的列表以及被驱逐的原因：`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl get pods --all-namespaces -o go-template='{{range .items}}{{if eq .status.phase "Failed"}}{{if eq .status.reason "Evicted"}}{{.metadata.name}}{{" "}}{{.metadata.namespace}}{{"\\n"}}{{end}}{{end}}{{end}}' | while read epod enamespace; do kubectl -n $enamespace get pod $epod -o=custom-columns=NAME:.metadata.name,NODE:.spec.nodeName,MSG:.status.message; done
`}</code></pre>
    <h3 {...{
      "id": "job-的状态一直没有变更为-completed"
    }}>{`Job 的状态一直没有变更为 Completed`}</h3>
    <p>{`如果您启用了 Istio，而且部署了 Job 之后，Job 的状态一直没有变更为`}<strong parentName="p">{`Completed`}</strong>{`，您需要参考`}<a parentName="p" {...{
        "href": "/docs/rancher2/istio/2.3.x-2.4.x/setup/enable-istio-in-namespace/_index"
      }}>{`这些步骤`}</a>{`手动添加 annotation。`}</p>
    <p>{`因为 Istio Sidecarh 会无休止地运行，即使 Job 的任务完成了，它的状态也不能被视为`}<strong parentName="p">{`Completed`}</strong>{`。上述步骤是在短期内处理这个问题的方法，它禁止了 Istio 和添加了 annotation 的 Pod 之间的通信。如果您使用了这种方式解决这个问题，这个 Job 就没有权限访问 service mesh，不能够用于集成测试。`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
